	def numeric_gravity_compensation(qArray, mode = 2):
		if mode == 1:
			return self._num_grav_cmp_v0(qArray[0], qArray[1], qArray[2])
		elif mode == 2:
			return self.half_elbow_torques(qArray[0], qArray[1], qArray[2])
		else:
			rospy.logfatal("KinematicsInterface: Undefined mode for gravity compensation.")

